dient(to bottom,\n      rgba(255, 215, 0, 1) 0%,\n      rgba(255, 215, 0, 0.8) 50%,\n      rgba(255, 215, 0, 0.2) 100%\n    );\n  box-shadow: \n    0 5px 15px rgba(255, 215, 0, 0.5),\n    0 10px 25px rgba(255, 215, 0, 0.3);\n}\n\n.curtain-left {\n  left: 0;\n  transform-origin: left center;\n  background-image: \n    linear-gradient(to right, \n      rgba(0, 0, 0, 0.2) 0%, \n      transparent 20%\n    );\n}\n\n.curtain-right {\n  right: 0;\n  transform-origin: right center;\n  background-image: \n    linear-gradient(to left, \n      rgba(0, 0, 0, 0.2) 0%, \n      transparent 20%\n    );\n}\n\n/* Curtain opening animation */\n.curtain-container.opening .curtain-left {\n  transform: translateX(-100%);\n}\n\n.curtain-container.opening .curtain-right {\n  transform: translateX(100%);\n}\n\n/* Western Background */\n.western-background {\n  position: fixed;\n  top: 0;\n  left: 0;\n  width: 100%;\n  height: 100%;\n  z-index: -10;\n  background: \n    url('../../public/img/background.webp') center center / cover no-repeat;\n  overflow: hidden;\n  animation: desertWind 20s ease-in-out infinite;\n}\n\n\n@keyframes desertWind {\n  0%, 100% { \n    filter: hue-rotate(0deg) brightness(1); \n  }\n  25% { \n    filter: hue-rotate(5deg) brightness(1.05); \n  }\n  50% { \n    filter: hue-rotate(0deg) brightness(0.95); \n  }\n  75% { \n    filter: hue-rotate(-5deg) brightness(1.02); \n  }\n}"],"sourceRoot":""}]);
